"Milano, via Newton, zona San Siro/Segesta, disponiamo di unità immobiliare di circa 414 mq. disposta su tre livelli come segue.
Piano terra: autorimessa, ingresso, vano di ascensore, locale sgombero, vasca, doccia, locale tecnico e ripostiglio;
Piano primo: quattro locali, disimpegno e due servizi igienici;
Piano secondo: soppalco, archivio, centrale termica, ripostiglio e servizio igienico.
Completa la soluzione una piscina privata al piano terra. L'immobile presenta serramenti esterni in alluminio con vetrocamera, quelli interni in legno laccato a battente e scorrevoli, pareti interne rasate a gesso e pavimentazione in legno."
